<!DOCTYPE html>
<html lang="zh-cmn-Hans">

<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            list-style: none;
        }

        #header {
            margin: 0 auto;
            padding: 10px 0;
        }

        #main {
            padding: 20px;
        }

        .image-box {
            position: relative;
            width: 100%;
            font-size: 0;
        }

        .image-box img {
            display: block;
            margin: 0 auto;
        }

        #whale {
            position: relative;
            left: 0;
            margin: 0;
            animation: whale_move_02 10s infinite steps(10000);
        }

        @keyframes whale_move_01 {
            0% {
                transform: translateX(0) scale(1, 1);
            }

            24% {
                transform: translateX(-100%) scale(1, 1);
            }

            26% {
                transform: translateX(-100%) scale(-1, 1);
            }

            50% {
                transform: translateX(0) scale(-1, 1);
            }

            74% {
                transform: translateX(100%) scale(-1, 1);
            }

            76% {
                transform: translateX(100%) scale(1, 1);
            }

            100% {
                transform: translateX(0) scale(1, 1);
            }
        }

        @keyframes whale_move_02 {
            0% {
                left: 0;
                transform: scale(-1, 1);
            }

            49% {
                left: calc(100% - 400px);
                transform: scale(-1, 1);
            }

            51% {
                left: calc(100% - 400px);
                transform: scale(1, 1);
            }

            98% {
                left: 0;
                transform: scale(1, 1);
            }

            100% {
                left: 0;
                transform: scale(-1, 1);
            }
        }
    </style>
</head>
